CREATE DATABASE /*!32312 IF NOT EXISTS*/`hikh_tms` /*!40100 DEFAULT CHARACTER SET latin1 */;

USE `hikh_tms`;

/*Table structure for table `booking` */

DROP TABLE IF EXISTS `booking`;

CREATE TABLE `booking` (
  `epf_no` int(11) NOT NULL,
  `user_name` varchar(100) NOT NULL,
  `mobile_no` int(11) NOT NULL,
  `email` varchar(150) NOT NULL,
  `booking_date` datetime NOT NULL,
  `destination` varchar(50) NOT NULL,
  `reason` varchar(300) NOT NULL,
  `vehicle_type` varchar(50) NOT NULL,
  `status` int(11) NOT NULL DEFAULT '0',
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `approved_by` varchar(45) NOT NULL,
  `department` varchar(100) NOT NULL,
  `jtype` varchar(20) NOT NULL,
  `passenger` int(11) NOT NULL,
  `pickup_date` datetime NOT NULL,
  PRIMARY KEY (`id`,`user_name`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `booking` */

/*Table structure for table `department` */

DROP TABLE IF EXISTS `department`;

CREATE TABLE `department` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `department_name` varchar(45) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=latin1;

/*Data for the table `department` */

insert  into `department`(`id`,`department_name`) values (1,'HR'),(2,'MERCHANDISING'),(3,'IT'),(4,'DESIGNING'),(5,'PLANNING'),(6,'PACKING'),(7,'MIS_(DATA ENTRY)'),(8,'WORK_STUDY'),(9,'FABRIC_TECHNOLOGY'),(10,'FABRIC_INSPECTION'),(11,'STORES'),(12,'CUTTING'),(13,'PROCESS_SYSTEM'),(14,'SAMPLE'),(15,'QUALITY');

/*Table structure for table `designation` */

DROP TABLE IF EXISTS `designation`;

CREATE TABLE `designation` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=latin1;

/*Data for the table `designation` */

insert  into `designation`(`id`,`name`) values (1,'MANAGER'),(2,'GENERAL_MANAGER'),(3,'SENIOR EXECUTIVE'),(4,'EXECUTIVE'),(5,'MERCHANDISER'),(6,'TRAINEE MERCHANDISER'),(7,'DESIGNER'),(8,'TRAINEE DESIGNER'),(9,'ASISTANT_MANAGER'),(10,'HEAD_OF_DEPARTMENT'),(11,'ADMIN'),(12,'TRANSPORT_DEPARTMENT'),(13,'ASSISTANT');

/*Table structure for table `driver` */

DROP TABLE IF EXISTS `driver`;

CREATE TABLE `driver` (
  `frist_name` varchar(30) NOT NULL,
  `last_name` varchar(30) NOT NULL,
  `address` varchar(150) NOT NULL,
  `mobile_no` int(11) NOT NULL,
  `licence_no` varchar(11) NOT NULL,
  `expiry_date` date NOT NULL,
  `experience` int(11) NOT NULL,
  `note` text NOT NULL,
  `image` longblob NOT NULL,
  PRIMARY KEY (`licence_no`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

