/*Table structure for table `goods_delivery` */

DROP TABLE IF EXISTS `goods_delivery`;

CREATE TABLE `goods_delivery` (
  `user_name` varchar(100) NOT NULL,
  `epf_no` int(11) NOT NULL,
  `mobile_no` int(11) NOT NULL,
  `email` varchar(150) NOT NULL,
  `booking_date` datetime NOT NULL,
  `pickup_address` varchar(200) NOT NULL,
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `dapartment` varchar(45) NOT NULL,
  `contact_person` varchar(45) NOT NULL,
  `contact_person_mobile` int(11) NOT NULL,
  `po_number` varchar(45) NOT NULL,
  `goods_detaill` varchar(200) NOT NULL,
  `reason` varchar(100) NOT NULL,
  `approved_by` varchar(45) NOT NULL,
  `status` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`,`user_name`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=latin1;

