/*Table structure for table `staff_transport` */

DROP TABLE IF EXISTS `staff_transport`;

CREATE TABLE `staff_transport` (
  `epf_no` varchar(100) NOT NULL,
  `user_name` varchar(45) NOT NULL,
  `mobile_no` int(11) NOT NULL,
  `email` varchar(200) NOT NULL,
  `department` varchar(45) NOT NULL,
  `j_type` varchar(45) NOT NULL,
  `passengers` int(11) NOT NULL,
  `destination` varchar(150) NOT NULL,
  `reason` varchar(150) NOT NULL,
  `vehicle_type` varchar(45) NOT NULL,
  `approved_by` varchar(45) NOT NULL,
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `b_epf` varchar(45) NOT NULL,
  `b_name` varchar(45) NOT NULL,
  `b_mobile` int(11) NOT NULL,
  `b_department` varchar(45) NOT NULL,
  `status` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`,`epf_no`)
